webpackJsonp([0x87046ee59208],{351:function(A,a){A.exports={data:{markdownRemark:{html:'<p><strong><em>The Blow</em></strong><br>\n<em>Poor Aim: Love Songs</em><br>\nThis is my new favorite record to listen to super loudly! It\'s super slickly produced, but still mega fun because it\'s crunchy, poppy, and soft-hearted, and not over done.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/the-blow-poor-aim-28787a248c19fbda1b9c221fe4b129b3-8e2e9.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; margin-top:10px;; max-width: 300px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 100%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="the-blow-poor-aim"\n        title=""\n        src="/static/the-blow-poor-aim-28787a248c19fbda1b9c221fe4b129b3-8e2e9.jpg"\n        srcset="/static/the-blow-poor-aim-28787a248c19fbda1b9c221fe4b129b3-dd96d.jpg 148w,\n/static/the-blow-poor-aim-28787a248c19fbda1b9c221fe4b129b3-eaf39.jpg 295w,\n/static/the-blow-poor-aim-28787a248c19fbda1b9c221fe4b129b3-8e2e9.jpg 300w"\n        sizes="(max-width: 300px) 100vw, 300px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p><strong><em>Bobby Birdman</em></strong><br>\n<em>Giraffes and Jackals</em><br>\nThis was partly produced by the guy who produced Poor Aim, but this is a lot less fun. It\'s croony and proggy and not as touching as Poor Aim.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/bobby-birdman-giraffes-576a06a810f146f65faffdd2b3b7d575-8e2e9.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; margin-top:10px;; max-width: 300px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 99%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="bobby-birdman-giraffes"\n        title=""\n        src="/static/bobby-birdman-giraffes-576a06a810f146f65faffdd2b3b7d575-8e2e9.jpg"\n        srcset="/static/bobby-birdman-giraffes-576a06a810f146f65faffdd2b3b7d575-dd96d.jpg 148w,\n/static/bobby-birdman-giraffes-576a06a810f146f65faffdd2b3b7d575-eaf39.jpg 295w,\n/static/bobby-birdman-giraffes-576a06a810f146f65faffdd2b3b7d575-8e2e9.jpg 300w"\n        sizes="(max-width: 300px) 100vw, 300px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p><strong><em>Reading Rainbow</em></strong><br>\n<em>Prism Eyes</em><br>\nFast and lo fi, but neither screechy or preachy punk. The bright noisiness doesn\'t bleach the color out either. It\'s an earnest and well-captured achievement of sounding young.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/reading-rainbow-prism-eyes-4b24fcdfa591f85696a3d63c603a03f6-8e2e9.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; margin-top:10px;; max-width: 300px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 100%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="reading-rainbow-prism-eyes"\n        title=""\n        src="/static/reading-rainbow-prism-eyes-4b24fcdfa591f85696a3d63c603a03f6-8e2e9.jpg"\n        srcset="/static/reading-rainbow-prism-eyes-4b24fcdfa591f85696a3d63c603a03f6-dd96d.jpg 148w,\n/static/reading-rainbow-prism-eyes-4b24fcdfa591f85696a3d63c603a03f6-eaf39.jpg 295w,\n/static/reading-rainbow-prism-eyes-4b24fcdfa591f85696a3d63c603a03f6-8e2e9.jpg 300w"\n        sizes="(max-width: 300px) 100vw, 300px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p><strong><em>Joseph Shabason</em></strong><br>\n<em>Anne</em><br>\nA very personal project - this saxaphonist composed these Wyndham Hill-like ambient jazz around monologues of his mom describing her traumas. Demands emotional concentration and rewards with relaxation.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/joseph-shabason-anne-626be137a186374b5ebd39990385355b-8e2e9.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; margin-top:10px;; max-width: 300px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 100%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="joseph-shabason-anne"\n        title=""\n        src="/static/joseph-shabason-anne-626be137a186374b5ebd39990385355b-8e2e9.jpg"\n        srcset="/static/joseph-shabason-anne-626be137a186374b5ebd39990385355b-dd96d.jpg 148w,\n/static/joseph-shabason-anne-626be137a186374b5ebd39990385355b-eaf39.jpg 295w,\n/static/joseph-shabason-anne-626be137a186374b5ebd39990385355b-8e2e9.jpg 300w"\n        sizes="(max-width: 300px) 100vw, 300px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p><strong><em>Lee Morgan</em></strong><br>\n<em>Indeed!</em><br>\nI love this! On a Lee Morgan jag lately. This is his debut. This record, and his other early bandleader records, I guess, are great lessons on the bop\'s origins in soul music. I love how this album careens that between the two.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/lee-morgan-indeed-5d844763e553fecb3753abea2046543a-8e2e9.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; margin-top:10px;; max-width: 300px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 100%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="lee-morgan-indeed"\n        title=""\n        src="/static/lee-morgan-indeed-5d844763e553fecb3753abea2046543a-8e2e9.jpg"\n        srcset="/static/lee-morgan-indeed-5d844763e553fecb3753abea2046543a-dd96d.jpg 148w,\n/static/lee-morgan-indeed-5d844763e553fecb3753abea2046543a-eaf39.jpg 295w,\n/static/lee-morgan-indeed-5d844763e553fecb3753abea2046543a-8e2e9.jpg 300w"\n        sizes="(max-width: 300px) 100vw, 300px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p><strong><em>Mix Mup</em></strong><br>\n<em>Beach Hotel De Haan</em><br>\nI forgot that Mix Mup isn\'t a Kassem Mosse alias. It seemed totally plausible that this is Kassem Mosse actually making club tracks. And it\'s awesome! I wish he would. Or that I should get some more Mix Mup records.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/mix-mup-beach-hotel-3149f20fe6ab9f19ba773f892da80727-8e2e9.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; margin-top:10px;; max-width: 300px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 100%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="mix-mup-beach-hotel"\n        title=""\n        src="/static/mix-mup-beach-hotel-3149f20fe6ab9f19ba773f892da80727-8e2e9.jpg"\n        srcset="/static/mix-mup-beach-hotel-3149f20fe6ab9f19ba773f892da80727-dd96d.jpg 148w,\n/static/mix-mup-beach-hotel-3149f20fe6ab9f19ba773f892da80727-eaf39.jpg 295w,\n/static/mix-mup-beach-hotel-3149f20fe6ab9f19ba773f892da80727-8e2e9.jpg 300w"\n        sizes="(max-width: 300px) 100vw, 300px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>',frontmatter:{date:"December 21, 2018",path:"/the-blow-lee-morgan-etc",title:"The Blow, Lee Morgan, Reading Rainbow, and more"}}},pathContext:{}}}});
